import React from 'react';
import styles from '../header/header.module.css'
import { findByLabelText } from '@testing-library/react';
class Header extends React.Component {


    render () {

        const navRightSide = {
            color: "red",
            marginLeft: "auto",
            float: "right",
            verticleAlign: "center",
            display: "flex",
            flexDirection: "row"
        };

        const verticleCenterMenuOptions = {
            lineHeight: "5rem",
            textAlign: "center",
            verticleAlign: "center"
        }

        const pStyle = {
            marginBottom: "0px",
            marignLeft: "20px",
            marignRight: "50px",

        }

        var Logo = () => {
            return (
                <a><img src="imgs/git.png" className={styles.logo}></img></a>
            );
        }

        var LeftSideTopNav = () => {
            return ( 
            <div className="col-3" style={verticleCenterMenuOptions}>
                <div className={styles.LogoWrapper}>
                    <Logo/>
                </div>
            </div>
            );
        }

        var RightSideTopNav = () => {
            return (
            <div className="col-9" style={verticleCenterMenuOptions}>
                <div style={navRightSide}> 
                <p style={pStyle}>About Me</p>
                <p style={pStyle}>Social Media</p>
                <p style={pStyle}>Contact Me</p>
                </div>
            </div>
            );
        }

        return (
            <div className={styles.headerOuter}>
                <div className="container">
                    <div className="row" >
                            <LeftSideTopNav/>
                            <RightSideTopNav/>
                    </div>
                </div>
            </div>
        );
    }
}

export default Header;
